import React from 'react';
import { Table } from 'reactstrap';

const DataSection = ({obj}) => {
  console.log('obj', JSON.parse(obj))
  return (
    <div>
      <p>{obj}</p>
      <Table>
       <thead>
         <tr>
           <th>day</th>
           <th>date</th>
           <th>low</th>
           <th>high</th>
           <th>text</th>
           <th>code</th>
         </tr>
       </thead>
       <tbody>
       {obj.forecasts && obj.forecasts.map((item, i) => 
         <tr key={i}>
           <td>{item.day}</td>
           <td>{item.date}</td>
           <td>{item.low}</td>
           <td>{item.high}</td>
           <td>{item.text}</td>
           <td>{item.code}</td>
        </tr>
       )} 
       </tbody>
    </Table>
    </div>
  );
};

export default DataSection;
